import { useState } from "react";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { title: "Skin Burns", body: "lorem ipsum...", id: 1 },
    { title: "Bruises", body: "lorem ipsum...", id: 2 },
    { title: "Cuts", body: "lorem ipsum...", id: 3 },
  ]);
  //   let scanStatus = "Incomplete";
  const [scanStatus, setScanStatus] = useState("Incomplete");
  const handleClick = () => {
    setScanStatus("Complete");
  };

  return (
    <div className="home">
      <h2>Homepage</h2>
      <p>{scanStatus}</p>
      <button onClick={handleClick}>Click Here</button>
    </div>
  );
};

export default Home;
